const rusakhilang_toggle = document.getElementById("tanggal_rusakhilang");
t=document.getElementById("toggle_rusakhilang");

if(t){
    t.addEventListener("click", function () {
        if (t.value > 1) {
            rusakhilang_toggle.classList.remove("d-none");
          }else if (t.value == 1){
            rusakhilang_toggle.classList.add("d-none");
          }
      });
}
